import React, {Fragment} from 'react';
import { Link } from 'react-router-dom';

function Navigation(){

    return(
        <Fragment>
            <ul style={{display: 'flex'}}>
                <Link to="/">
                    <li className="menu">Accueil</li>
                </Link>
                <Link to="/test1">
                    <li>test1</li>
                </Link>
                <Link to="/test2">
                    <li>test2</li>
                </Link>
                
            </ul>
        </Fragment>
    )
}

export default Navigation
